 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>OPEN STAGE</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:19px;font-family:'Book Antiqua';\">The Open Stage at Museum Pustaka Lontar is an area designed as an open space for various cultural and educational activities. It serves as the main stage for events such as Bulan Bahasa Bali, art performances, cultural discussions, and other activities that support the preservation of lontar heritage. With its open and flexible design, the Open Stage is able to accommodate many participants, making it an ideal location for interactive activities. The existence of this venue not only adds to the attractiveness of the museum, but also provides a space for the community to participate in efforts to preserve Balinese culture and literature in a more dynamic manner.</SPAN></SPAN></DIV></div>",
