 "class": "HTMLText",
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;font-family:Georgia, serif;\"><B>MUSEUM PUSTAKA LONTAR</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:22px;font-family:Georgia, serif;\"><B>Traditional Village of Dukuh Penaban, Karangasem, Bali</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:19px;font-family:'Book Antiqua';\">Museum Pustaka Lontar was inaugurated on April 11, 2017 in the traditional village of Dukuh Penaban, Karangasem Village, Bali Province. Museum Pustaka Lontar was established as an effort to preserve lontar. Lontar is a traditional writing medium made from tal leaves. Lontar holds Balinese cultural values and knowledge, including religious texts, history, politics, medicine, and local wisdom. Starting from the awareness of the community of the traditional village of Dukuh Penaban about the condition of the lontar, which is widely owned by the community in the traditional village of Dukuh Penaban, which is not maintained, this museum was built in mutual cooperation on a village land of 1.5 hectares. The main building, Bale Sangkul Putih, serves as a center for lontar education, conservation and training. In addition, the museum serves as an educational tourism and meeting space, with facilities such as Bale Asta Brata for Hindu-based discussions and early childhood education, and Wantilan Singarsa Gosana to display the lontar collection. Museum Pustaka Lontar is now a center for the preservation of Bali's cultural heritage as well as an educational facility for future generations. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:19px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
